import React from 'react';
import { useHistory } from 'react-router-dom'; // Assuming you're using react-router-dom for routing

export default function AdminHome() {
  const history = useHistory();

  const handleLogout = () => {
    window.location.href = '/login'; // Assuming logout functionality
  };

  
  const handleExpertRegistration = () => {
    history.push('/expertRegistration'); // Redirecting to expert registration page
  };

  return (
    <div>
      <h1>Welcome Admin</h1>
      <button onClick={handleLogout}>Logout</button>
      <button onClick={handleExpertRegistration}>Expert Registration</button>
    </div>
  );
}
